import React, { Component } from 'react';
import { Row, Col } from 'react-simple-flex-grid';
import { Card, CardTitle, CardText, CardFooter, CardHeader, CardBody, Button } from 'reactstrap';
import "react-simple-flex-grid/lib/main.css";


class GymGrid extends Component {
  constructor(props) {
    super(props);
    this.state = {
      availableGyms: [
        {
          "env_id": "CartPole-v0",
          "category":"Classic Control",
          "description": "A pole is attached by an un-actuated joint to a cart, which moves along a frictionless track.",
          "image": "https://user-images.githubusercontent.com/8510097/31701291-3b9f3d94-b384-11e7-8ee1-70fb1e7deb63.PNG",
          "status": "Available"
        },
        {
          "env_id": "Pendulum-v0",
          "category":"Classic Control",
          "description": "Try to keep a frictionless pendulum standing up.",
          "image": "https://user-images.githubusercontent.com/8510097/31701471-726f54c0-b385-11e7-9f05-5c50f2affbb4.PNG",
          "status": "Available"
        },
        {
          "env_id": "MountainCarContinuous-v0",
          "category":"Classic Control",
          "description": "An underpowered car must climb a one-dimensional hill to reach a target.",
